selector_to_html = {"a[href=\"#front-matter\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Front matter<a class=\"headerlink\" href=\"#front-matter\" title=\"Link to this heading\">#</a></h4><p>Dado que en la configuraci\u00f3n inicial a\u00f1adimos un\n<a class=\"reference internal\" href=\"../crear-un-blog-con-sphinx/#blog-conf\"><span class=\"std std-ref\">patr\u00f3n de ruta</span></a> para las publicaciones,\nno es necesario agregar la directiva de <code class=\"docutils literal notranslate\"><span class=\"pre\">..post:</span></code> o el atributo de <code class=\"docutils literal notranslate\"><span class=\"pre\">:blogpost:</span> <span class=\"pre\">true</span></code>.\nSolo ubica los archivos en la ruta que cumpla el patr\u00f3n \ud83d\udc40.</p><p>Importante, en Nikola defin\u00edamos la ruta de navegaci\u00f3n mediante el <code class=\"docutils literal notranslate\"><span class=\"pre\">..slug:</span></code>, pero\nesto en Sphinx depende del nombre del archivo y su ruta en el directorio. Asegurate\nde usar la misma ruta de directorios al definido en el <em>slug</em> y el nombre del archivo\nigual a la parte final de este \ud83d\udc40. Otra opci\u00f3n, es que sin importar el nombre y ruta de\ndirectorios, uses el valor del <em>slug</em> como valor de <code class=\"docutils literal notranslate\"><span class=\"pre\">:redirect:</span></code> (en este caso, a\u00f1ade\nal archivo de configuraci\u00f3n <code class=\"docutils literal notranslate\"><span class=\"pre\">post_redirect_refresh=0</span></code>).</p>", "a[href=\"#referencias\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Referencias<a class=\"headerlink\" href=\"#referencias\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#migrando-mi-blog-de-nikola-a-sphinx\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Migrando mi blog de Nikola a Sphinx<a class=\"headerlink\" href=\"#migrando-mi-blog-de-nikola-a-sphinx\" title=\"Link to this heading\">#</a></h1><p>Migrar de un generador est\u00e1tico a otro no es un proceso del todo transparente,\nas\u00ed que aqu\u00ed te explico algunos por menores para hacer una migraci\u00f3n de Nikola\na Sphinx.</p><p>Pero antes, es necesario tener presente, que lo b\u00e1sico del proceso de migraci\u00f3n,\ninicia por tener lo m\u00ednimo desde cero, con Sphinx. Para este fin, debes seguir las\nindicaciones dadas en <a class=\"reference internal\" href=\"../crear-un-blog-con-sphinx/\"><span class=\"std std-doc\">Crear un blog con Sphinx</span></a>.</p>", "a[href=\"#youtube\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Youtube<a class=\"headerlink\" href=\"#youtube\" title=\"Link to this heading\">#</a></h4><p>Necesitamos instalar <code class=\"docutils literal notranslate\"><span class=\"pre\">sphinxcontrib-youtube</span></code> y habilitar <code class=\"docutils literal notranslate\"><span class=\"pre\">sphinxcontrib.youtube</span></code>\nen las extensiones. De esta forma, la directiva de <code class=\"docutils literal notranslate\"><span class=\"pre\">..</span> <span class=\"pre\">youtube::</span></code> sigue tal cual.</p>", "a[href=\"#migrando\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Migrando<a class=\"headerlink\" href=\"#migrando\" title=\"Link to this heading\">#</a></h2><p>Bueno, una vez tenemos la base de nuestro blog, sigue hacer los ajustes para que\nnuestras entradas previas sigan funcionando.</p>", "a[href=\"#configuracion\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n<a class=\"headerlink\" href=\"#configuracion\" title=\"Link to this heading\">#</a></h3><h4>Archivos en el ra\u00edz<a class=\"headerlink\" href=\"#archivos-en-el-raiz\" title=\"Link to this heading\">#</a></h4><p>Los archvos en el ra\u00edz, se definen en un directorio que disponemos con la variable\n<code class=\"docutils literal notranslate\"><span class=\"pre\">html_extra_path</span></code>, la cual podemos definir con el mismo nombre que viene en Nikola\n(<code class=\"docutils literal notranslate\"><span class=\"pre\">files</span></code>).</p>", "a[href=\"#publicacion\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Publicaci\u00f3n<a class=\"headerlink\" href=\"#publicacion\" title=\"Link to this heading\">#</a></h3><h4>Front matter<a class=\"headerlink\" href=\"#front-matter\" title=\"Link to this heading\">#</a></h4><p>Dado que en la configuraci\u00f3n inicial a\u00f1adimos un\n<a class=\"reference internal\" href=\"../crear-un-blog-con-sphinx/#blog-conf\"><span class=\"std std-ref\">patr\u00f3n de ruta</span></a> para las publicaciones,\nno es necesario agregar la directiva de <code class=\"docutils literal notranslate\"><span class=\"pre\">..post:</span></code> o el atributo de <code class=\"docutils literal notranslate\"><span class=\"pre\">:blogpost:</span> <span class=\"pre\">true</span></code>.\nSolo ubica los archivos en la ruta que cumpla el patr\u00f3n \ud83d\udc40.</p><p>Importante, en Nikola defin\u00edamos la ruta de navegaci\u00f3n mediante el <code class=\"docutils literal notranslate\"><span class=\"pre\">..slug:</span></code>, pero\nesto en Sphinx depende del nombre del archivo y su ruta en el directorio. Asegurate\nde usar la misma ruta de directorios al definido en el <em>slug</em> y el nombre del archivo\nigual a la parte final de este \ud83d\udc40. Otra opci\u00f3n, es que sin importar el nombre y ruta de\ndirectorios, uses el valor del <em>slug</em> como valor de <code class=\"docutils literal notranslate\"><span class=\"pre\">:redirect:</span></code> (en este caso, a\u00f1ade\nal archivo de configuraci\u00f3n <code class=\"docutils literal notranslate\"><span class=\"pre\">post_redirect_refresh=0</span></code>).</p>", "a[href=\"#archivos-en-el-raiz\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Archivos en el ra\u00edz<a class=\"headerlink\" href=\"#archivos-en-el-raiz\" title=\"Link to this heading\">#</a></h4><p>Los archvos en el ra\u00edz, se definen en un directorio que disponemos con la variable\n<code class=\"docutils literal notranslate\"><span class=\"pre\">html_extra_path</span></code>, la cual podemos definir con el mismo nombre que viene en Nikola\n(<code class=\"docutils literal notranslate\"><span class=\"pre\">files</span></code>).</p>", "a[href=\"#sistema-de-comentarios\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Sistema de comentarios<a class=\"headerlink\" href=\"#sistema-de-comentarios\" title=\"Link to this heading\">#</a></h4><p>Si usamos Disqus (en Nikola, <code class=\"docutils literal notranslate\"><span class=\"pre\">COMMENT_SYSTEM='disqus'</span></code>), el <code class=\"docutils literal notranslate\"><span class=\"pre\">disqus_shortname</span></code> en\nel archivo de configuraci\u00f3n toma el valor del antiguo <code class=\"docutils literal notranslate\"><span class=\"pre\">COMMENT_SYSTEM_ID</span></code>.</p>", "a[href=\"#contenido\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Contenido<a class=\"headerlink\" href=\"#contenido\" title=\"Link to this heading\">#</a></h4><p>En algunos casos, pod\u00edamos recurrir a listados de publicaciones mediante alg\u00fan\nfiltro con <code class=\"docutils literal notranslate\"><span class=\"pre\">..</span> <span class=\"pre\">post-list::</span></code> y el atributo de <code class=\"docutils literal notranslate\"><span class=\"pre\">:categories</span></code>. Esto ahora pasa a\n<code class=\"docutils literal notranslate\"><span class=\"pre\">..</span> <span class=\"pre\">postlist::</span></code> con el atributo <code class=\"docutils literal notranslate\"><span class=\"pre\">:category:</span></code> (puedes usar otros filtros tambi\u00e9n).</p><p>Respecto a <code class=\"docutils literal notranslate\"><span class=\"pre\">..</span> <span class=\"pre\">thumbnail::</span></code> esta directiva no existe, y se reemplaza por <code class=\"docutils literal notranslate\"><span class=\"pre\">..</span> <span class=\"pre\">figure::</span></code>.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
